        # Exponent = (0.9478 + 0.00018 * ln(1+a)) * ( 1 + 0.004*sin(2.8*a) + 0.001*cos(3.8*a) + 0.003*sin(3.4*a) + 0.002*cos(4.4*a) + 0.001*sin(2.9*a) )
        Exponent = (0.9478 + 0.00018 * math.log(1+a)) * ( 1 + 0.004*math.sin(2.8*a) + 0.001*math.cos(3.8*a) + 0.003*math.sin(3.4*a) + 0.002*math.cos(4.4*a) + 0.001*math.sin(2.9*a) )

        # f = sign(z) * ( f_adapt * T * extra )^(Exponent)
        f = sign(z) * ( f_adapt * T * extra )**(Exponent)

        # U = beta + gamma * f
        U = beta + gamma * f

        # P_accept = 1/(1+exp(-U))
        try:
            P_accept = 1/(1+math.exp(-U))
        except OverflowError:
            P_accept = 0.0

        model_predictions.append(P_accept)

    return model_predictions
